import React from "react";

type col = {
    colores:string[],
}



export default function CambioColorBackGround(props:col){



    const color = () =>   Math.floor(Math.random() * props.colores.length) ;



    const BackGround = {
        background:props.colores[color()],
    }



    return(

        <main style = {BackGround}>
        {props.colores}
            <div style={{background : 'blue'}}>
               colores
            </div>
            <button onClick={color}></button>



        </main>

    );


}
